import React, { useState, useEffect } from 'react';
import Navbar from '../components/Navbar';
import Hero from '../components/Hero';
import Footer from '../components/Footer';
import HotelList from '../components/HotelList';
import Filter from '../components/Filter';

function Servicios() {
  const [hotels, setHotels] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [newHotel, setNewHotel] = useState({
    name: '',
    location: '',
    rating: 0,
    price: 0,
    images: []
  });

  // Obtener la lista de alojamientos
  const fetchHotels = async () => {
    try {
      const response = await fetch('http://localhost:3001/alojamiento/getAlojamientos');
      if (!response.ok) {
        throw new Error('Error al obtener los alojamientos');
      }
      const data = await response.json();
      setHotels(data);
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchHotels();
  }, []);

  // Crear un nuevo alojamiento
  const createHotel = async (newHotel) => {
    try {
      const response = await fetch('http://localhost:3001/alojamiento/createAlojamiento', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newHotel),
      });
      if (!response.ok) {
        throw new Error('Error al crear el alojamiento');
      }
      const createdHotel = await response.json();
      setHotels([...hotels, createdHotel]);
    } catch (error) {
      setError(error.message);
    }
  };

  // Actualizar un alojamiento existente
  const updateHotel = async (id, updatedData) => {
    try {
      const response = await fetch(`http://localhost:3001/alojamiento/putAlojamiento/${id}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(updatedData),
      });
      if (!response.ok) {
        throw new Error('Error al actualizar el alojamiento');
      }
      fetchHotels(); // Fetch updated hotels
    } catch (error) {
      setError(error.message);
    }
  };

  // Eliminar un alojamiento existente
  const deleteHotel = async (id) => {
    try {
      const response = await fetch(`http://localhost:3001/alojamiento/deleteAlojamiento/${id}`, {
        method: 'DELETE',
      });
      if (!response.ok) {
        throw new Error('Error al eliminar el alojamiento');
      }
      setHotels(hotels.filter(hotel => hotel.idAlojamiento !== id));
    } catch (error) {
      setError(error.message);
    }
  };

  const handleFilterChange = (filters) => {
    const filteredHotels = hotels.filter((hotel) => {
      return (
        (!filters.location || hotel.ubicacion.toLowerCase().includes(filters.location.toLowerCase())) &&
        (filters.minRating === 0 || hotel.rating >= filters.minRating) &&
        (filters.maxPrice === 0 || hotel.precioPorDia <= filters.maxPrice)
      );
    });
    setHotels(filteredHotels);
  };

  const handleClearFilters = () => {
    fetchHotels();
  };

  const handleChange = (e) => {
    setNewHotel({
      ...newHotel,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    createHotel(newHotel);
  };

  if (loading) {
    return <div>Cargando...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <>
      <Navbar />
      <Hero
        cName="hero-mid"
        heroImg="https://i.postimg.cc/qqBp3KdY/heather-gill-Wlhfy-AHmp-II-unsplash.jpg"
        title="Servicios"
        btnClass="hide"
      />
      <div className="catalog">
        <Filter onFilterChange={handleFilterChange} onClearFilters={handleClearFilters} />
        <HotelList hotels={hotels} onDeleteHotel={deleteHotel} onUpdateHotel={updateHotel} />
        {/* Formulario para crear un nuevo alojamiento */}
        <form onSubmit={handleSubmit}>
          <input type="text" name="name" placeholder="Nombre" onChange={handleChange} required />
          <input type="text" name="location" placeholder="Ubicación" onChange={handleChange} required />
          <input type="number" name="rating" placeholder="Rating" onChange={handleChange} required />
          <input type="number" name="price" placeholder="Precio por día" onChange={handleChange} required />
          <button type="submit">Crear Nuevo Alojamiento</button>
        </form>
      </div>
      <Footer />
    </>
  );
}

export default Servicios;
